    property :"creator/DonaldsonLithoCo", :label => 'Donaldson Litho Co.', :comment =>
      %(Daniel, Noel; Magic: 1400s-1950s, Cologne: Taschen, 2009.
        Located in Newport, Kentucy. The Donaldson Art Sign Company in
        Covington and the Donaldson Lithography Company in Newport can
        be traced back to a partnership between William M. Donaldson
        and Henry Elms. These two entrepreneurs began a small
        lithography business in Cincinnati on August 10, 1863 . By the
        end of the first year of operation, the firm owned and
        operated seven hand printing presses. With the death of Mr.
        Elms in 1872, the business became the sole property of
        Donaldson. The company was officially incorporated as the
        Donaldson Lithograph Co. in 1883.)
