    property :"creator/JacobbergerJames", :label => 'Jacobberger, James', :comment =>
      %(Name and dates derived from a website. Joseph \(Josef\)
        Jacobberger was born in Lautenbach, France on 1869 March 19
        and moved to the United States with his family in 1872. Raised
        in Omaha, Neb., he received his degree in architecture from
        Creighton University. Joseph first set up his architectural
        practice in Minneapolis, Minn., then moved to California, and
        finally settled in Oregon in the l890s. For a time, he worked
        for the firm of Whidden and Lewis, after which he set up his
        own firm in 1900 and then formed Jacobberger & Smith with his
        colleague, Alfred H. Smith, in 1912. He designed residences,
        Catholic churches, and institutional and public buildings and
        was also Oregon chapter president of the American Institute of
        Architects \(A.I.A.\). Joseph married Anne Mary Lillis \(b.
        1863\) in Portland on 1893 May 2, and the couple had six
        children, including son Francis Benedict Jacobberger. Joseph
        Jacobberger died on 1930 March 18. Francis Benedict
        Jacobberger was born in Portland, Or. on 1898 February 17. He
        attended the University of Oregon in Eugene, Or. and started
        his architectural career as a draftsman in his father\'s firm
        in 1921. Francis founded the firm Jacobberger and Stanton and
        also worked for the firm Jacobberger, Stanton, and Zeller, as
        well as Jacobberger, Franks, and Norman. He designed numerous
        Catholic churches, schools, hospitals, and other institutional
        buildings, including St. Francis Church and Providence
        Hospital in Portland, Or. Like his father, Francis served as
        president of the Oregon chapter of the American Institute of
        Architects \(A.I.A.\) from 1945-1946, and he also co-authored
        Oregon\'s architectural practices law. Francis married Maude
        Cowles Barnes \(b. 1898\) in 1923, and the couple had two
        daughters. Francis Benedict Jacobberger died on 1962 February
        4.)
