    property :"creator/MArtGroup", :label => 'M Art Group', :comment =>
      %(Gao Minglu; Total Modernity and the Avant-Garde in
        Twentieth-Century Chinese Art. An artist collective founded in
        October 1986 by Song Haidong who taught at the Shanghai Art
        College. In the group\'s manifesto, they advocated that
        artists leave their studios and engage with the people at
        large, thus bypassing the old value systems and institutions.
        In their performance art, the works were unconventional: often
        violent, masochistic and sadistic, featuring wild behavior and
        violence enacted on their own and each others\' bodies.)
