    property :"creator/NaessandMurphy", :label => 'Naess and Murphy', :comment =>
      %(UO VRC Slide Collections. The firm Shaw, Naess and Murphy,
        founded by Alfred Shaw, Sigurd Naess and Charles F. Murphy in
        1937, became Naess and Murphy, then C.F. Murphy Associates in
        1957, and Murphy/Jahn in 1981. Gene R. Summers was Partner in
        Charge of Design at C.F. Murphy Associates from 1967 to 1973.
        Helmut Jahn joined C.F. Murphy Associates in 1967. He became
        Principal and Director of Planning and Design in 1973. C.F.
        Murphy Associates and Pace Associates were associated
        architectural firms with Ludwig Mies van der Rohe for Crown
        Hall \(Illinois Institute of Technology, Chicago, Illinois\),
        1950-1956.)
