    property :"creator/RichardsonClare", :label => 'Richardson, Clare', :comment =>
      %(Name and dates derived from a website. Born in London in 1973,
        Clare Richardson studied in Bristol for her BA, worked as an
        assistant for several leading fashion photographers including
        Liz Collins and Rankin, before returning to fine art practice.
        To date, her projects have explored marginal communities
        rooted in the idyllic and mythical; social groups beyond the
        mainstream who occupy alternative territories associated with
        another time, place and ideology. Behind this work resides the
        legacy of Richardson\'s own background of perpetual relocation
        \(\'a peripatetic childhood\'\) that has instilled an ongoing
        fascination with a sense of belonging.)
