    property :"creator/UtagawaKuniaki", :label => 'Utagawa, Kuniaki', :comment =>
      %(Clark, Timothy; Ukiyo-e Paintings in the British Museum,
        Washington, D.C.: Smithsonian Institution Press, 1992. Family
        name Hirazawa; father was a minor samurai in the fourteenth
        division of castle guards. Kuniaki was a pupil of Kunisada,
        producing actor and genre prints and paintings of beauties
        during the late Edo.)
    property :"creator/UtagawaKunihiro", :label => 'Utagawa, Kunihiro', :comment =>
      %(Schwaab, Dean J.; Osaka Prints, New York: Rizzoli
        International Publications Inc., 1989. Japanese Ukiyo-e
        printmaker; worked in Edo and Osaka; pupil of Toyokuni II;
        specialized in actor prints. Alt. names: Ganjosai, Konantei,
        Sanshotei.)
    property :"creator/UtagawaKunihisa", :label => 'Utagawa, Kunihisa', :comment =>
      %(Clark, Timothy; Ukiyo-e Paintings in the British Museum,
        Washington, D.C.: Smithsonian Institution Press, 1992. A
        senior pupil of Toyokuni I who may have been a woman artist,
        according to one account, though this may refer to Kunihisa\'s
        daughter.)
    property :"creator/UtagawaKunimaru", :label => 'Utagawa, Kunimaru', :comment =>
      %(Name and dates derived from a website. Also signed prints with
        the name Bunji)
    property :"creator/UtagawaKunimasaV", :label => 'Utagawa, Kunimasa V', :comment =>
