        Washington, D.C.: Smithsonian Institution Press, 1992. student
        of Toyokuni I)
    property :"creator/UtagawaKunisadaII", :label => 'Utagawa, Kunisada II', :comment =>
      %(Name and dates derived from a website.)
    property :"creator/UtagawaKunitora", :label => 'Utagawa, Kunitora', :comment =>
      %(Name and dates derived from a website. Pupil of Toyokuni; is
        said to have worked under his teacher\'s name. His work was
        scanty. Somewhat influenced by Hokusai and Shunshosai Hokuju,
        his prints also show signs of Western influence in pronounced
        contrasts in light. Some works reminiscent of artists of the
        preceeding generation.)
    property :"creator/UtagawaSadahiro", :label => 'Utagawa, Sadahiro', :comment =>
      %(Roberts, Laurance P.; Dictionary of Japanese Artists:
        Painting, Sculpture, Ceramics, Prints, Lacquer, First
        paperback edition, Tokyo; New York: Weatherhill, 1990.
        Japanese Ukiyo-e printmaker, studied under Kunisada, worked in
        Edo and Osaka. Changed his name many times, may be the same
        person as Utagawa Hirosada. Alternate names: Gochotei,
        Gokitei, Gorakutei, Gosotei, Kogado.)
    property :"creator/UtagawaSadakage", :label => 'Utagawa, Sadakage', :comment =>
      %(Name and dates derived from a website.)
    property :"creator/UtagawaSadamasu", :label => 'Utagawa, Sadamasu', :comment =>
      %(Roberts, Laurance P.; Dictionary of Japanese Artists:
        Painting, Sculpture, Ceramics, Prints, Lacquer, First
        paperback edition, Tokyo; New York: Weatherhill, 1990.
        Japanese Ukiyo-e printmaker; student of Kunisada; minor Osaka
        actor print designer. Alt. name: Gochotei)
    property :"creator/UtagawaSadatora", :label => 'Utagawa, Sadatora', :comment =>
      %(Dorrington-Ward, Carol; Fans from the East, New York:
        Debrett\'s Peerage Limited, 1978.)
    property :"creator/UtagawaToyokuni", :label => 'Utagawa, Toyokuni', :comment =>
      %(Roberts, Laurance P.; Dictionary of Japanese Artists:
        Painting, Sculpture, Ceramics, Prints, Lacquer, First
        paperback edition, Tokyo; New York: Weatherhill, 1990.)
    property :"creator/UtagawaToyokuniII", :label => 'Utagawa, Toyokuni II', :comment =>
      %(Roberts, Laurance P.; Dictionary of Japanese Artists:
        Painting, Sculpture, Ceramics, Prints, Lacquer, First
        paperback edition, Tokyo; New York: Weatherhill, 1990.
        Japanese Ukiyo-e painter, illustrator, worked in Edo. he was
        the pupil, son-in-law and adopted son of Toyokuni I. Alternate
        names: Toyoshige, Genzo, Gosotei \(Kosetei\), Gosotei
        Toyokuni, Ichibetsusai, Ichieisai, Ichiryusai, Kunishige,
        Toyokuni.)
    property :"creator/UtagawaToyonaga", :label => 'Utagawa, Toyonaga', :comment =>
      %(Clark, Timothy; Ukiyo-e Paintings in the British Museum,
        Washington, D.C.: Smithsonian Institution Press, 1992.)
    property :"creator/UtagawaToyonobu", :label => 'Utagawa, Toyonobu', :comment =>
      %(Pins, Jacob; Japanese Pillar Print: Hashira-e, London: Robert
        G. Sawers Publishing, 1982. Ukiyo-e printmaker. Some scholars
        feel that this is merely an early name for Utagawa Toyoharu;
        others regard him as identical with Ishikawa Toyonobu; still
        others think he was a pupil of Ishikawa Toyonobu. It is
        probable that he was a fellow-artist--and possibly and
        brother--of Toyoharu. Prints with this signature very rare:
        only six or so have survived.)
    property :"creator/UtagawaYoshiku", :label => 'Utagawa, Yoshiku', :comment =>
      %(Kanada, Margaret Miller; Color Woodblock Printmaking: The
        Traditional Method of Ukiyo-e, Fourth Printing, Tokyo:
        Shufunotomo Co., Ltd., 1989 \(4079753160\).)
    property :"creator/UtagawaYoshitaki", :label => 'Utagawa, Yoshitaki', :comment =>
      %(Roberts, Laurance P.; Dictionary of Japanese Artists:
        Painting, Sculpture, Ceramics, Prints, Lacquer, First
        paperback edition, Tokyo; New York: Weatherhill, 1990.
        Japanese Ukiyo-e printmaker, worked in Edo and Osaka. Pupil of
        Yoshiume, member of the Kamigata-e school, leading designer of
        actor prints in Osaka between 1860 and 1880. Alt. names:
        Tsunejiro, Handenshakyo, Hogyoku, Ichiyosai, Ichiyotei,
        Ittensai, Jueido, Noriya, Satonoya, Yosui.)
