    property :"creator/WhitehouseStantonandChurch", :label => 'Whitehouse, Stanton & Church', :comment =>
      %(http://nwda.orbiscascade.org/ark:/80444/xv29419. During the
        early 1920s, Whitehouse practiced under the firm name of
        Morris H. Whitehouse, Architect. In 1926, the name was changed
        to Morris H. Whitehouse & Associates after he established a
        partnership with A. Glenn Stanton and Walter E. Church.
        Significant projects from this period include Temple Beth
        Israel, the United States Courthouse, and Multnomah Civic
        Stadium in Portland, Or. In 1932, the firm became known as
